$mainwdith: 1280px;
$contentheight: 100%;
.app-container {
  width: $mainwdith;
  background-color: #fff;
  margin: 0 auto;
  padding: 30px;
  margin-top:20px;
  box-shadow: 1px 1px 1px #eee;
  .deviceimg{
    font-size: 42px;
  }
  .infotittle{
    position: relative;
      top:-15px;
      left: 5px;
      margin-bottom: -25px;
    h4{      
      font-size: 18px;
      color:#73abcc;
      position: relative;
      top:-5px;
    }
    p{
      font-size: 12px;
      color: #555;
      position: relative;
      top: -20px;
    }
  }
}
.pagebox {
  margin-top: 10px;
}
.myprojectbox {
  background-color: #fff;
  height: 70px;
  border-bottom: 1px #efeef3 solid;
  //   box-shadow: 0 2px 12px 0 rgba(0, 0, 0, 0.1);
  .myproject {
    width: $mainwdith;
    margin: 0 auto;
    line-height: 70px;
    font-size: 20px;
    .mytite {
      float: left;
    }
    .addbt {
      float: right;
      margin: 15px;
      background-color: #7db6d7;
      border: none;
    }
    .addbt:hover {
      background-color: #73abcc;
    }
  }
